const reducer = (state = [], action ) =>{
  switch (action.type) {
    case "FETCH_Data":
      return action.payload;
    case "SIGNIN":
      console.log(action.payload);
      localStorage.setItem("profile", JSON.stringify({...action.data}))
      return [...state, action.payload]
    default:
      return state;
  }
}

export default reducer
